import axios from "../utils/axios";

import { GET_ERRORS, SET_TASKS, CLEAR_ERRORS } from "./types";

export const getTasks = taskParams => dispatch => {
	return axios.get(`/tasks/assigned?page=1&limit=5&order=task_id&orderMethod=ASC`, { headers: {"accessToken" : `${localStorage.getItem("jwtToken")}`} }).then(res => {

        dispatch({
            type: SET_TASKS,
            payload: res.data
        });


        return res.data
    }).catch((error)=>{
        console.log(error)
    })
};
